$(document).ready(function(){$("#formLogin").submit(e=>{e.preventDefault();const t=new FormData($("#formLogin").get(0));$.ajax({url:`${apiUrl}/auth/login`,method:"post",data:t,processData:!1,contentType:!1,cache:!1,dataType:"JSON",beforeSend:function(){disableButton()},complete:function(){enableButton()},success:function(e){200==e.statusCode&&(window.location=`${baseUrl}/auth/authenticating/${btoa(e.access.access_token)}/${e.verified_email}`)},error:function(e){const t=e.responseJSON;500==t.statusCode&&msgSweetError(t.message,1),401==t.statusCode&&msgSweetWarning(t.message),validate(t.input),enableButton()}})})});